import React from 'react';
import {Marker} from 'react-google-maps';


const CustomMarker = (props) => {
    const {id} = props;

    const onMarkerClick = (evt) => {
        console.log(id);
    };
}
class Clicks extends React.Component {

    render() {
        return (

        <Marker
            onClick={onMarkerClick}
            {...props}
        />
    )
        }}

export default Clicks;
